import React from 'react';
import ProductComponent from './ProductComponent';

const Main = ({ products }) => {
    return (
        <div className="main">
            {products.map(product => (
                <ProductComponent
                    key={product.id}
                    image={product.image}
                    name={product.name}
                    description={product.description}
                    type={product.type}
                    price={product.price}
                    rating={product.rating}
                />
            ))}
        </div>
    );
};

export default Main;
